import React from 'react';
import ActivityMap from './ActivityMap';

export default function ActivityCard({ activity, onJoin, addToast }) {
  return (
    <div className="card mb-3">
      <div className="card-body">
        <h5 className="card-title">{activity.title}</h5>
        <p className="card-text">{activity.description}</p>
        <p className="card-text"><small className="text-muted">Lugar: {activity.location}</small></p>
        {activity.latitude && activity.longitude && (
          <div className="mb-3">
            <ActivityMap latitude={activity.latitude} longitude={activity.longitude} />
          </div>
        )}
        <button className="btn btn-primary" onClick={onJoin}>Inscribirse</button>
      </div>
    </div>
  );
}
